pragma solidity >=0.6.0;

import "./safemath.sol";
import "./initializeGame.sol";

contract projectGame is initializeGame {
    using SafeMath for uint256;
    uint256 public currentRound = 1;

    function listCards() public view returns (uint256[] memory) {
        return (cards);
    }

    function randomCard(uint256 _player) public {
        require(players[_player].balance >= 10);
        uint256 newCard = generateCards(cardModValue);
        cards.push(newCard);
        cardToOwner[newCard] = _player;
        players[_player].balance.sub(10);
    }
}
